sing your slippage tolerance.":"Hierdie transaksie sal ook nie slaag nie as gevolg van prysbeweging of fooi by oordrag. Probeer u glyverdraagsaamheid verhoog.","This transaction will result in a":"This transaction will result in a","Transaction deadline":"Transaksiesperdatum","Transaction rejected":"Transaksie afgekeur","Transaction submitted":"Transaksie ingedien","Try again":"Try again","Try increasing your slippage tolerance.<0/>NOTE: Fee on transfer and rebase tokens are incompatible with Uniswap V3.":"Probeer om jou gliptoleransie te verhoog.<0/>LET WEL: Fooi op oordrag en herbasis-tokens is onversoenbaar met Uniswap V3.","Unexpected error. Could not estimate gas for the swap.":"Onverwagte fout. Kon nie gas vir die ruil skat nie.","Unexpected issue with estimating the gas. Please try again.":"Onverwagte probleem met die skatting van die gas. Probeer asseblief weer.","Use the Uniswap Labs API to get faster quotes.":"Use the Uniswap Labs API to get faster quotes.","View on Etherscan":"Uitsig op Etherscan","Wallet disconnected":"Wallet disconnected","Warning":"Waarskuwing","You pay":"You pay","You receive":"You receive","Your swap failed.":"Your swap failed.","Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.":"Your swap was modified through your wallet. If this was a mistake, please cancel immediately or risk losing your funds.","Your transaction will revert if it has been pending for longer than this period of time.":"Jou transaksie sal terugdraai as dit vir langer as hierdie tydperk hangende was.","Your transaction will revert if the price changes unfavorably by more than this percentage.":"U transaksie gaan terug as die prys met meer as hierdie persentasie ongunstig verander.","minutes":"minute","price impact on the market price of this pool. Do you wish to continue?":"price impact on the market price of this pool. Do you wish to continue?","{0} approval failed":[["0"]," approval failed"],"{